window.bridges["generate-random-time"]=function(){return{converter:function(){var r=this.options.get(),t=+r.count,e=r.format,n=r.start,i=r.end;if(!/\d+:\d+:\d+/.test(n))throw new Error("Invalid start time, doesn't match h:m:s");if(!/\d+:\d+:\d+/.test(i))throw new Error("Invalid end time, doesn't match h:m:s");var a=parseInt(n.split(":")[0],10),o=parseInt(n.split(":")[1],10),s=parseInt(n.split(":")[2],10),m=parseInt(i.split(":")[0],10),h=parseInt(i.split(":")[1],10),d=parseInt(i.split(":")[2],10);if(isNaN(a))throw new Error("Start time hour isn't a valid number");if(isNaN(o))throw new Error("Start time minute isn't a valid number");if(isNaN(s))throw new Error("Start time second isn't a valid number");if(isNaN(m))throw new Error("End time hour isn't a valid number");if(isNaN(h))throw new Error("End time minute isn't a valid number");if(isNaN(d))throw new Error("End time second isn't a valid number");if(24<a)throw new Error("Start time hour bigger than 24");if(60<o)throw new Error("Start time minute bigger than 60");if(60<s)throw new Error("Start time second bigger than 60");if(24<m)throw new Error("End time hour bigger than 24");if(60<h)throw new Error("End time minute bigger than 60");if(60<d)throw new Error("End time second bigger than 60");var w=3600*a+60*o+s,g=3600*m+60*h+d;if(g<w)throw new Error("Start time is bigger than end time");for(var l,f,p="",u=0;u<t;u++){var E=(l=w,f=g,parseInt(Math.random()*(f-l+1)+l,10).toString()),c=parseInt(E/3600,10),v=c;1==v.toString().length&&(v="0"+v);var b=parseInt(E%3600/60,10),I=b;1==I.toString().length&&(I="0"+I);var N=parseInt(E%60,10),S=N;if(1==S.toString().length&&(S="0"+S),"hh-mm-ss"==e)p+=v+":"+I+":"+S;else if("h-m-s"==e)p+=c+":"+b+":"+N;else if("custom"==e){var M=r["custom-format"];p+=M=(M=(M=(M=(M=(M=M.replace("hh",v)).replace("h",c)).replace("mm",I)).replace("m",b)).replace("ss",S)).replace("s",N)}p+="\n"}return p},config:{}}};